    List<ManufactureMaster> articleModel;
    string voucherNo = string.Empty;
    Privilege privi = new Privilege();
    string strMenu = "Manufacture";
    bool strAdd = true;
    bool strEdit = true;
    bool strDelete = true;
    bool strShow = true;
    protected override void OnInitialized()
    {
        //CheckPriviliage
        privi = priviliageRepository.PriviliageCheck(strMenu, 1, 1);
        if (privi != null)
        {
            strAdd = privi.AddAction;
            strEdit = privi.EditAction;
            strDelete = privi.DeleteAction;
            strShow = privi.ShowAction;
            if (strShow == false)
            {
                Toaster.Add("You dont have to privilege.", MatToastType.Success, "dashboard", null);
                navManager.NavigateTo("dashboard");
            }
        }
        else
        {
            strAdd = true;
            strEdit = true;
            strDelete = true;
            strShow = true;
        }
        LoadData();
    }
    protected void LoadData()
    {
        articleModel = manufacturerepository.ViewManufacture(1, 1, voucherNo);
    }

    async Task Delete(long id)
    {
        if (strDelete == true)
        {
            bool confirmed = await JsRuntime.InvokeAsync<bool>("confirm", "Are you sure?");
            if (confirmed)
            {
                bool isSave = false;
                //isSave = manufacturerepository.DeleteManufacture(id);
                if (isSave == true)
                {
                    Toaster.Add("Delete Successfully.", MatToastType.Info, "Manufacture", null);
                    LoadData();
                    navManager.NavigateTo("inventory/salesinvoicelist");
                }
                else
                {
                    Toaster.Add("Cannot be delete. already in used.", MatToastType.Warning, "Manufacture", null);
                    navManager.NavigateTo("inventory/salesinvoicelist");
                }
            }
        }
        else
        {
            Toaster.Add("You dont have to privilege.", MatToastType.Success, "dashboard", null);
            navManager.NavigateTo("dashboard");
        }
    }

